(4, '5663JzmTV126UbmX5mpQoZh6.jpeg', '2020 JFX TEMBUS TARGET, 2021 JFX FOKUS PERUBAHAN DAN PENGEMBANGAN', '<p><strong>Review 20</strong><strong>20</strong>&nbsp;</p>\r\n\r\n<p>Bursa Berjangka Jakarta (BBJ) atau&nbsp;Jakarta Futures Exchange&nbsp;(JFX) dipertengahan&nbsp;tahun 2020 telah&nbsp;<strong>MENEMBUS TARGET</strong>&nbsp;tahun 2020. Pencapaian total transaksi kontrak hingga pertengahan bulan November telah melebihi &nbsp;dari target 8,25 juta Lot, yaitu sebesar 8,252 juta Lot atau 0,03%.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Kinerja perdagangan hingga 16&nbsp;November 2020, terdapat kenaikan yang signifikan, sebesar&nbsp;22,46&nbsp;% yaitu&nbsp;8.252.710,24&nbsp;Lot dari&nbsp;6.739.081,55&nbsp;Lot di tahun 2019 dengan periode yang sama.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Hingga pertengahan November 2020, Volume transaksi untuk kontrak Multilateral&nbsp;telah&nbsp;mencapai&nbsp;1.450.030&nbsp;Lot, dari yang ditargetkan sebesar 1.750.000 Lot.&nbsp; Sementara itu, volume transaksi untuk kontrak Bilateral, telah melampaui target yaitu sebesar&nbsp;6.802.680,24&nbsp;&nbsp;Lot dari 6.500.000&nbsp;Lot&nbsp;yang ditargetkan atau sebesar&nbsp;4,65&nbsp;%.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Stephanus Paulus Lumintang</strong><strong>,</strong>&nbsp;Direktur Utama Jakarta Futures Exchange&nbsp;mengatakan, &ldquo;meskipun hingga pertengahan bulan November ini&nbsp;(16/11)&nbsp;kontrak Multilateral baru mencapai&nbsp;83&nbsp;%&nbsp;dari&nbsp;target, namun kami yakin pada akhir tahun akan dapat&nbsp;mencapai&nbsp;target.&rdquo;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Harga komoditi emas yang cukup fluktuatif sepanjang tahun 2020&nbsp;&nbsp;menjadi pendorong ramainya transaksi Kontrak Berjangka Emas di Bursa Berjangka Jakarta khususnya di masa pandemi ini. Begitupun&nbsp;demand&nbsp;Kopi&nbsp;di pasar lokal yang semakin tinggi dan harga yang membaik dibanding tahun lalu menjadi pemicu pertumbuhan transaksi kopi. Sementara&nbsp;dengan adanya revitalisasi Kontrak Olein 10 juga penyumbang transaksi yang cukup besar&nbsp;di Bursa Berjangka Jakarta.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Kinerja kontrak tersebut tidak lepas dari peran pialang&nbsp;dan pedagang dan dukungan kebijakan dari Bappebti&nbsp;serta&nbsp;para pelaku pasar yang semakin dewasa dalam berinvestasi&nbsp;merupakan andil yang besar yang tidak&nbsp;dapat dipisahkan dalam&nbsp;peningkatan volume transaksi pada tahun 2020.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Fajar Wibhiyadi</strong>,&nbsp;<em>Direktur Utama PT Kliring Berjangka Indonesia (Persero)</em>&nbsp;mengatakan, &ldquo;Pencapaian volume transaksi di Bursa Berjangka Jakarta kali ini tentu merupakan hal yang positif bagi Industri Perdagangan Berjangka Komoditi, ditengah pandemi yang melanda Indonesia sejak awal tahun. Ini semua merupakan bukti bahwa industri perdagangan berjangka komoditi cukup tahan terhadap kontraksi ekonomi, baik nasional maupun global. Terkait transaksi Multilateral, merupakan pekerjaan rumah bagi semua pemangku kepentingan, untuk kedepan bisa meningkatkan volume transaksi. Hal ini karena khittahnya industri perdagangan berjangka komoditi adalah transaksi multilateral&rdquo;.</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<p><strong>Pasar Fisik Emas Digital</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Jakarta Futures Exchange (JFX)&nbsp;di bulan November 2020, telah menerima Surat Keputusan Badan Pengawas Perdagangan Berjangka Komoditi Nomor 01/BAPPEBTI/SP-BBPF/11/2020 tentang&nbsp; Persetujuan Bursa Berjangka untuk Melakukan Kegiatan Penyelenggaraan Pasar Fisik Emas Digital.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dengan mengantongi Surat Keputusan yang diterbitkan pada tanggal 11 November tersebut, mengukuhkan JFX sebagai penyelenggara Pasar Fisik Digital&nbsp;yang berkolaborasi dengan Kliring Berjangka Indonesia (KBI) yang telah ditunjuk sebagai Lembaga Kliring Penyelesaian dan Penjaminan Transaksi di Pasar Fisik Emas Digital (LK-PFED).&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Pelaksanaan ini merupakan penyelarasan kepada Peraturan Menteri Perdagangan&nbsp;No. 119 tahun 2018, tentang kebijakan umum mengenai perdagangan fisik emas digital di Bursa Berjangka dan peraturan Bappebti No.13 tahun 2019 tentang perubahan atas peraturan Bappebti No. 04 tahun 2019 tentang Ketentuan Teknis Penyelenggaraan Pasar Fisik Emas Digital di Bursa Berjangka.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&ldquo;Saat ini JFX sudah siap untuk menerima pendaftaran kepesertaan, dan sedang melakukan sosialisasi kepada calon peserta dan investor.&nbsp; Untuk keterangan lebih lanjut bisa menghubungi divisi Keanggotaan kami&rdquo;, ujar&nbsp;<strong>Stephanus Paulus Lumintang.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Stephanus Paulus Lumintang</strong>&nbsp;menambahkan, bahwa untuk mekanisme transaksi Emas Digital, JFX menawarkan 2 pilihan mekanisme transaksi yang memudahkan para&nbsp;<em>Investor</em>&nbsp;dan para Pelaku Industri,&nbsp; melalui metode&nbsp;<em>On Exchange</em>&nbsp; dan juga mekanisme transaksi secara&nbsp;<em>Off Exchange</em>. Selain itu, JFX juga menyediakan&nbsp;transaksi terkecil mulai dari 1 lot = 0,0001 gram, hingga yang terbesar 1 lot = 10.000 gram.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Fajar Wibhiyadi</strong>&nbsp;menambahkan, &ldquo;Dengan mulai berjalannya Pasar Fisik Emas Digital, tentunya ini akan meningkatkan ekosistem di pedagangan emas digital. Kita tahu, adanya transformasi teknologi dan Industri 4.0 yang telah masuk ke semua sektor kehidupan, menjadikan kegiatan yang serba digital akan menjadi kebutuhan masyarakat. Dengan melihat potensi yang ada, kami optimis Pasar Fisik Emas Digital kedepan akan terus tumbuh&rdquo;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Prospek &amp; Outlook 20</strong><strong>21</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Memasuki tahun 2021,&nbsp;JFX&nbsp;Sebagai&nbsp;<em>Self Regulatory Organization</em>&nbsp;(SRO),&nbsp; menetapkan tahun 2021&nbsp;sebagai tahun&nbsp;<strong>&ldquo;Perubahan dan Pengembangan&rdquo;</strong>.&nbsp;Di tengah-tengah kondisi industri yang masih marak dengan praktek investasi ilegal, dan fluktuatifnya beberapa harga komoditas yang dipedagangkan khusunya di masa pandemik ini, manajemen BBJ justru optimis bahwa dengan strategi yang diterapkan dengan menciptakan sinergi dan koordinasi yang maksimal di antara pemangku kepentingan (Regulator, SRO, Asosiasi, Anggota Bursa, Pelaku Usaha, Pemerintah Daerah), industri PBK akan bertumbuh/berkembang lebih baik dari periode-periode sebelumnya.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&ldquo;Di tahun depan, JFX akan menambahkan dan memperluas kerjasama dengan bursa-bursa dan pelaku pasar di luar negeri, untuk menstimulus dan mempercepat pencapaian referensi harga&rdquo;, ujar&nbsp;<strong>Stephanus Paulus Lumintang.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Pengembangan dan perbaikan akan dilakukan di semua lini organisasi, terutama di bidang sumber daya manusia (struktur organisasi dan etos kerja). Hal ini dilakukan demi efisiensi dan peningkatan produktivitas, serta menjadikan sumber daya yang siap berkiprah di era globalisasi.&nbsp;Melalui perbaikan yang dilakukan baik secara internal maupun antar-lembaga, diharapkan perubahan ini berdampak positif bagi industri dan perusahaan baik dalam hal&nbsp;<em>industrialpositioning</em>&nbsp;maupun dalam hal&nbsp;<em>financial result</em>.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Tahun 2021, BBJ akan fokus pada program-program sebagai berikut:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&middot;Meningkatkan pelayanan baik pelayanan administrasi maupun teknologi informasi kepada Anggota Bursa dan pemangku kepentingan di Industri Perdagangan Berjangka;</p>\r\n\r\n<p>&middot;Fokus dan penguatan produk multilateral Kontrak Berjangka CPO, Olein dan produk terkait Emas, khususnya Kontrak Emas Syariah, dan Kopi&nbsp;yang akan menjadi produk yang menjadi fokus pengembangan di BBJ/JFX, menyiapkan Pasar Fisik&nbsp;Kelapa/Kopra.Diharapkan salah satu kontrak berjangka tersebut akan dapat meningkatkan likuiditas BBJ/JFX;</p>\r\n\r\n<p>&middot;Meningkatkan pendapatan melalui pengembangan dan pemberdayaan ragam sumber pendapatan baik operasional maupun non operasional,serta mengupaya-kan pengembangankontrak berjangka yang baru;</p>\r\n\r\n<p>&middot;Melakukan efisiensi dengan meningkatkan aktifitas dan kualitas usaha;</p>\r\n\r\n<p>&middot;Melakukan beberapa inisiatif yang bertujuan meningkatkan layanan;</p>\r\n\r\n<p>&middot;Meningkatkan sinergi bersama Regulator, SRO dan Asosiasi-Asosiasi terkait.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Secara umum, di tengah-tengah dinamika dan tantangan perusahaan yang semakin besar dalam industri PBK, tahun 2021&nbsp;BBJ akan memberikan perhatian&nbsp; ekstra pada upaya peningkatan&nbsp;pendapatan&nbsp;melalui ragam sumber pendapatan potensial,&nbsp;termasuk likuiditas manajemen (pengelolaan likuiditas) dalam berinvestasi&nbsp;serta fokus pada upaya peningkatan&nbsp; kualitas dan kuantitas transaksi di produk kontrak berjangka yang telah ada, termasuk peningkatan kualitas layanan bagi para anggota bursa dan pemangku kepentingan, intensifikasi kegiatan pengawasan industri, serta ekstensifikasi kegiatan sosialisasi perihal PBK bagi masyarakat umum, media dan sivitas akademika.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Selanjutnya Fajar Wibhiyadi memambahkan, &ldquo;Seiring dengan mulai bergeraknya ekonomi pasca covid-19, kami optimis perdagangan berjangka komoditi kedepan akan terus tumbuh positif. Namun demikian, tetap menjadi tugas bersama para pemangku kepentingan untuk selalu melakukan edukasi dan literasi terkait dengan perdagangan berjangka komoditi sebagai salah satu alternatif investasi&rdquo;.</p>\r\n', 'headline', '2021-01-14', 'admin', 0, '', '', '', '', '', '00:00:00'),
(5, '873956e78ff5e0a31fe4d4fb5c14158e6b7.png', 'Artikel 2', '<p>(Jakarta) Hari Selasa, 25 Agustus 2020 menjadi hari spesial bagi PT Kliring Berjangka Indonesia, Persero (KBI) karena KBI genap berusia 36 tahun. Untuk memperingati hari jadi tersebut, diselenggarakan perayaan sederhana yang mengundang Direksi dan Dewan Komisari dari PT Bursa Berjangka Jakarta (JFX), Anggota Kliring dan Perwakilan dari Asosiasi Perdagangan Berjangka Komoditi (ASPEBTINDO).</p>\r\n\r\n<p>Dalam pidato yang disampaikan oleh Stephanus Paulus Lumintang (SPL) selaku Direktur Utama JFX disematkan harapan &quot;Semoga kerjasama harmonis antara Bursa dan Kliring akan tetap terjalin untuk kemajuan Indonesia&quot;. Setelah sambutan dari SPL, kegiatan dilanjutkan dengan sambutan dari Fajar Wibhiyadi (FW) selaku Direktur Utama KBI.</p>\r\n\r\n<p>Setelah sambutan selesai, kegiatan selanjutnya adalah Pemotongan Tumpeng Pertama yang dilakukan oleh FW yang diserahkan kepada SPL. Dilanjutkan dengan Pemotongan Tumpeng Kedua yang dilakukan oleh Agung Rihayanto (AR) selaku Direktur KBI yang diserahkan kepada Hamdi Hassyarbaini (HH) selaku Direktur JFX. Kegiatan ini terselenggara dengan tetap mematuhi protokol kesehatan yang berlaku. Seluruh prosesi acara HUT KBI ke -36 ditutup dengan kegiatan foto bersama.</p>\r\n\r\n<p>KBI</p>\r\n', 'artikel', '2021-01-28', 'admin', 0, '', '', '', '', '', '00:00:00'),
(6, '8803hAwjpnlPVFkjch3AfU7k.jpeg', 'Memperingati HUT JFX ke-38', '<p>Setelah sambutan selesai, kegiatan selanjutnya adalah Pemotongan Tumpeng Pertama yang dilakukan oleh FW yang diserahkan kepada SPL. Dilanjutkan dengan Pemotongan Tumpeng Kedua yang dilakukan oleh Agung Rihayanto (AR) selaku Direktur KBI yang diserahkan kepada Hamdi Hassyarbaini (HH) selaku Direktur JFX. Kegiatan ini terselenggara dengan tetap mematuhi protokol kesehatan yang berlaku. Seluruh prosesi acara HUT KBI ke -36 ditutup dengan kegiatan foto bersama.</p>\r\n\r\n<p>KBI</p>\r\n\r\n<p>KBI didirikan pada tanggal 25 Agustus 1984, yang merupakan salah satu otoritas pada industri berjangka dan derivatif di Indonesia yang saat ini sahamnya dimiliki secara penuh oleh Pemerintah Republik Indonesia.&nbsp;Pada tanggal 4 September&nbsp;2001&nbsp;melalui surat keputusan kepala&nbsp;Badan Pengawas Berjangka Komoditi&nbsp;(BAPPEBTI) No.128/IX/2001, KBI memperoleh izin operasional sebagai lembaga&nbsp;kliring&nbsp;berjangka guna menjalankan fungsi utamanya yaitu kliring, penjaminan, dan penyelesaian atas seluruh transaksi&nbsp;kontrak berjangka&nbsp;dan&nbsp;derivatif&nbsp;di Bursa atau Luar Bursa yang didaftarkan oleh masing-masing Anggota Kliring.</p>\r\n\r\n<p>KBI saat ini adalah sebagai pelaksana kliring dan penjaminan penyelesaian atas transaksi yang terjadi di&nbsp;JFX serta transaksi-transaksi yang terjadi di luar bursa yang dilakukan oleh anggota-anggotanya.</p>\r\n', 'artikel', '2021-01-28', 'admin', 0, '', '', '', '', '', '00:00:00');
