(4, '573983790f2b43f00be.png', 'Editor', '2021-04-08', '<ul>\r\n	<li>Digital contents planning for each GIS Business Unit</li>\r\n	<li>Maintain and manage all GIS Social Media accounts</li>\r\n	<li>Media coverage in every GIS events</li>\r\n	<li>Good copywriting skill for content&#39;s caption</li>\r\n	<li>Build good relationship with all principals and distributors through Social Media</li>\r\n</ul>\r\n', '<ul>\r\n	<li>Digital contents planning for each GIS Business Unit</li>\r\n	<li>Maintain and manage all GIS Social Media accounts</li>\r\n	<li>Media coverage in every GIS events</li>\r\n	<li>Good copywriting skill for content&#39;s caption</li>\r\n	<li>Build good relationship with all principals and distributors through Social Media</li>\r\n</ul>\r\n');
