INSERT INTO `jfx_persyaratan` (`id`, `judul`, `gambar`, `isi`, `petugas`, `slug_judul`) VALUES
(1, 'Persyaratan Anggota Bursa', NULL, '<p>Persyaratan menjadi Anggota Bursa :</p>\r\n\r\n<p>Anggota Pialang Berjangka</p>\r\n\r\n<ul>\r\n	<li>Mengisi formulir permohonan;</li>\r\n	<li>Membuat pernyataan yang dipersyaratkan;</li>\r\n	<li>Copy Akta Pendirian atau Anggaran Dasar Perseroan;</li>\r\n	<li>Mencantumkan kata BERJANGKA atau FUTURES pada nama perusahaan;</li>\r\n	<li>Miminal mempunyai 2 anggota Direksi dan 2 anggota Dewan Komisaris;</li>\r\n	<li>Perseroan Terbatas yang mempunyai kegiatan khusus;</li>\r\n	<li>Bersedia memiliki minimal 1 seat;</li>\r\n	<li>Neraca Perseroan Terbatas yang diaudit oleh Akuntan Publik;</li>\r\n	<li>Copy Kartu Tanda Penduduk/Paspor dan CV dari setiap anggota Dewan Komisaris dan Direksi Perseroan;</li>\r\n	<li>Copy Nomor Pokok Wajib Pajak Perseroan;</li>\r\n	<li>Membayar biaya pendaftaran sebesar Rp. 2.500.000 (belum termasuk PPN); dan</li>\r\n	<li>Memenuhi persyaratan lainnya yang ditetapkan Bursa Anggota Pedagang Perusahaan Mengisi formulir permohonan;</li>\r\n	<li>Membuat pernyataan yang dipersyaratkan;</li>\r\n	<li>Copy Akta Pendirian atau Anggaran Dasar Perseroan;</li>\r\n	<li>Copy Kartu Tanda Penduduk/Paspor dan CV dari setiap anggota Dewan Komisaris dan Direksi Perseroan;</li>\r\n	<li>Copy Nomor Pokok Wajib Pajak Perseroan;</li>\r\n	<li>Bersedia memiliki minimal 1 seat;</li>\r\n	<li>Membayar biaya pendaftaran sebesar Rp. 2.500.000 (belum termasuk PPN); dan</li>\r\n	<li>Memenuhi persayaratan lain yang ditetapkan Bursa.</li>\r\n</ul>\r\n\r\n<p>Anggota Pedagang Perorangan</p>\r\n\r\n<ul>\r\n	<li>Mengisi formulir permohonan;</li>\r\n	<li>Membuat pernyataan yang dipersyaratkan;</li>\r\n	<li>Copy Kartu Tanda Penduduk/Paspor dan CV dari Pemohon;</li>\r\n	<li>Copy tanda lulus pendidikan terakhir;</li>\r\n	<li>Copy Surat Keterangan ganti nama dari Departemen Kehakiman apabila pernah ganti nama;</li>\r\n	<li>Bersedia memiliki seat atau menyewa minimal 1 seat;</li>\r\n	<li>Membayar biaya pendaftaran sebesar Rp. 2.500.000 (belum termasuk PPN); dan</li>\r\n	<li>Memenuhi persayaratan lain yang ditetapkan Bursa.</li>\r\n</ul>\r\n\r\n<p>Download Link :</p>\r\n\r\n<ul>\r\n	<li>Surat Permohonan Anggota Bursa</li>\r\n	<li>Formulir Permohonan Anggota Bursa</li>\r\n	<li>Pernyataan Integritas Pernyataan</li>\r\n	<li>Permohonan Anggota Bursa</li>\r\n</ul>\r\n', NULL, NULL),
(2, 'Persyaratan Pasar Fisik Timah', NULL, '<ol>\r\n	<li>Persyaratan Peserta sebagai Penjual sebagai berikut :\r\n	<ul>\r\n		<li>Badan Hukum yang didirikan tunduk dan beradasarkan hukum Negara Republik Indonesia :\r\n		<ol>\r\n			<li>Fotokopi akta pendirian badan usaha, akta perubahan anggaran dasar dan akta perubahan susunan pengurus yang terakhir yang telah disahkan oleh Kementrian Hukum dan Hak Asasi Manusia;</li>\r\n			<li>Fotokopi surat keterangan domisili perusahaan (SKDP);</li>\r\n			<li>Fotokopi Nomor Pokok Wajib Pajak (NPWP) Pengurus dan Perusahaan;</li>\r\n			<li>Fotokopi identitas diri pengurus; dan/atau</li>\r\n		</ol>\r\n		</li>\r\n		<li>Izin Usaha Pertambangan (IUP) yang telah terdaftar di Minerba One Data Indonesia (MODI) Kementrian ESDM;</li>\r\n		<li>Memiliki Nomor Identitas Kepabeanan (NIK);</li>\r\n		<li>Memiliki Perizinan Ekspor (PE) Timah Murni Batangan yang masih aktif berlaku;</li>\r\n		<li>Eksportir Terdaftar (ET) Timah Murni Batangan yang masih aktif berlaku;</li>\r\n		<li>Memiliki Nomor Induk Berusaha (NIB);</li>\r\n		<li>Fotokopi laporan keuangan;</li>\r\n		<li>Fotokopi bukti biaya pendaftaran dan/atau iuran kepesertaan; dan</li>\r\n		<li>Formulir permohonan kepesertaan yang bentuk dan isinya ditetapkan oleh Bursa Timah.</li>\r\n	</ul>\r\n	</li>\r\n	<li>Persyaratan Peserta sebagai Pembeli sebagai berikut :\r\n	<ul>\r\n		<li>Pembeli Dalam Negeri :\r\n		<ol>\r\n			<li>Badan hukum yang didirikan&nbsp;tunduk dan beradasarkan hukum Negara Republik Indonesia;</li>\r\n			<li>Fotokopi akta pendirian badan usaha, akta perubahan anggaran dasar dan akta perubahan susunan pengurus yang terakhir yang telah disahkan oleh Kementrian Hukum dan Hak Asasi manusia;</li>\r\n			<li>Fotokopi surat keterangan domisili perusahaan (SKDP);</li>\r\n			<li>Fotokopi Nomor Pokok Wajib Pajak (NPWP) Pengurus dan Perusahaan;</li>\r\n			<li>Memiliki Nomor Induk Berusaha (NIB);</li>\r\n			<li>Fotokopi identitas diri pengurus;</li>\r\n			<li>Fotokopi Izin Usaha Industri (IUI) bagi Industri Timah atau surat pernyataan dari trader terkait penggunaan timah di negaranya untuk perusahaan dagang pengguna Timah Murni Batangan;</li>\r\n			<li>Fotokopi laporan keuangan;</li>\r\n			<li>Fotokopi bukti biaya pendaftaran dan/atau iuran kepesertaan; dan</li>\r\n			<li>Formulir permohonan kepesertaan, yang bentuk dan isinya ditetapkan oleh Bursa Timah.</li>\r\n		</ol>\r\n		</li>\r\n		<li>Pembeli Luar Negeri :\r\n		<ol>\r\n			<li>Surat referensi Bank luar negeri;</li>\r\n			<li>Surat keterangan domisili negara asal;</li>\r\n			<li>Profil Perusahaan (Company Profile);</li>\r\n			<li>Fotokopi Akta Pendirian Perusahaan berikut perubahannya (jika ada) yang telah disahkan oleh instansi berwenang di Negara Tempat kedudukan Perusahaan;</li>\r\n			<li>Fotokopi kartu identitas atau paspor yang masih berlaku dari komisaris dan direksi;</li>\r\n			<li>Surat keterangan izin usaha dari instansi terkait di Negara tempat kedudukan Perusahaan;</li>\r\n			<li>Surat Pernyataan sebagai Perusaan Pengguna Timah atau Surat Penunjukan sebagai wakil perusaan pengguna Timah;</li>\r\n			<li>Menyetor Jaminan Transaksi Timah (JTT);</li>\r\n			<li>Fotokopi bukti biaya pendaftaran dan/atau iuran kepertaan; dan</li>\r\n			<li>Formulir permohonan kepesertaan, yang bentuk dan isinya ditetapkan oleh Bursa Timah.</li>\r\n		</ol>\r\n		</li>\r\n	</ul>\r\n	</li> <br>\r\n	<li>Biaya Pendaftaran, Hak Akses Kepesertaan dan Iuran Tahunan Kepesertaan Bursa Timah sebagai berikut : <br>\r\n	<ul>\r\n		<li>Biaya Pendaftaran untuk menjadi Peserta Bursa Timah adalah sebesar <strong>USD110 (seratus sepuluh Dollar Amerika Serikat) </strong>termasuk PPN;</li>\r\n		<li>Hak Akses Kepesertaan Bursa Timah adalah sebesar <strong>USD33.000 (tiga puluh tiga ribu Dollar Amerika Serikat) </strong>termasuk PPN;</li>\r\n		<li>Iuran Tahunan Kepesertaan Bursa Timah adalah sebesar <strong>USD11.000 (sebelas ribu Dollar Amerika Serikat) </strong>termasuk PPN;</li>\r\n		<li>Biaya Pendaftaran dan Hak Akses Kepesertaan Bursa Timah sebagaimana dimaksud angka 1 (satu) dan angka 2 (dua) hanya dipungut 1 (satu) kali di awal Kepesertaan.</li>\r\n		<li>Iuran Tahunan Kepesertaan Bursa Timah dibayarkan setiap tahun pada tanggal efektif Kepesertaan</li>\r\n		<li>Biaya sebagaimana dimaksud di atas dapat berubah sewaktu-waktu yang ditetapkan melalui Surat Keputusan Bersama.</li>\r\n		<li>Hak Akses Kepesertaan dapat dialihkan kepada Peserta lain setelah mendapatkan verifikasi dari BBJ dan KBI.</li>\r\n	</ul>\r\n	</li>\r\n</ol>\r\n', NULL, NULL),
(3, 'Persyaratan Emas Digital', NULL, '<ol>\r\n	<li>Persyaratan Peserta sebagai Penjual sebagai berikut :\r\n	<ul>\r\n		<li>Administrasi :\r\n		<ol>\r\n			<li>Fotokopi akta pendirian badan usaha, akta perubahan anggaran dasar dan akta perubahan susunan pengurus yang terakhir yang telah disahkan oleh Kementrian Hukum dan Hak Asasi Manusia;</li>\r\n			<li>Fotokopi Nomor Pokok Wajib Pajak (NPWP);</li>\r\n			<li>Memiliki Nomor Induk Berusaha (NIB);</li>\r\n			<li>Fotokopi surat keterangan Domisili;</li>\r\n			<li>Daftar riwayat hidup Direksi dan Komisaris;</li>\r\n			<li>Fotokopi laporan keuangan 1 tahun terakhir yang telah diaudit oleh akuntan publik;</li>\r\n			<li>Fotokopi kartu identitas yang masih berlaku untuk komisaris dan direksi;</li>\r\n			<li>Formulir permohonan kepesertaan yang bentuk dan isinya ditetapkan oleh Bursa; dan</li>\r\n			<li>Surat Kuasa kepada Lembaga Kliring untuk pemantauan posisi dana pelanggan.</li>\r\n		</ol>\r\n		</li>\r\n		<li>Keuangan :\r\n		<ol>\r\n			<li>Fotokopi akta pendirian badan usaha, akta perubahan anggaran dasar dan akta perubahan susunan pengurus yang terakhir yang telah disahkan oleh Kementrian Hukum dan Hak Asasi Manusia;</li>\r\n			<li>Fotokopi Nomor Pokok Wajib Pajak (NPWP);</li>\r\n			<li>Memiliki Nomor Induk Berusaha (NIB);</li>\r\n			<li>Fotokopi surat keterangan Domisili;</li>\r\n			<li>Daftar riwayat hidup Direksi dan Komisaris;</li>\r\n			<li>Fotokopi laporan keuangan 1 tahun terakhir yang telah diaudit oleh akuntan publik;</li>\r\n			<li>Fotokopi kartu identitas yang masih berlaku untuk komisaris dan direksi;</li>\r\n			<li>Formulir permohonan kepesertaan yang bentuk dan isinya ditetapkan oleh Bursa; dan</li>\r\n			<li>Surat Kuasa kepada Lembaga Kliring untuk pemantauan posisi dana pelanggan.</li>\r\n		</ol>\r\n		</li>\r\n		<li>Teknis :\r\n		<ol>\r\n			<li>Pedagang Fisik Emas Digital wajib memfasilitasi transaksi Pelanggan Emas Digital melalui sistem transaksi fisik Emas Digital yang telah memperoleh persetujuan Kepala Bappebti;</li>\r\n			<li>Sistem transaksi fisik emas dan/atau sarana untuk kegiatan jual beli Emas Digital direkomendasikan oleh BBJ dan KBI kepada Bappebti untuk mendapatkan persetujuan Kepala&nbsp;Bappebti;</li>\r\n			<li>Sistem transaksi fisik emas dan/atau sarana sebelum direkomendasikan kepada&nbsp;Bappebti wajib terlebih dahulu diperiksa atau diaudit oleh lembaga independen yang memiliki sertifikasi dan kompetensi di bidang sistem informasi yang direkomendasikan oleh BBJ;</li>\r\n			<li>Dalam hal calon Peserta Kliring yang berasal dari Pedagang Fisik Emas Digital telah memenuhi persyaratan sebagaimana dimaksud pada angka 1 sampai dengan angka 3, Direksi BBJ dan KBI memberikan persetujuan dalam jangka waktu 5 (lima) hari kerja;</li>\r\n			<li>Menyimpan paling sedikit 10.000 (sepuluh ribu) gram Emas di tempat penyimpanan yang dikelola oleh Pengelola Tempat Penyimpanan;&nbsp;</li>\r\n			<li>Jumlah Emas sebagaimana dimaksud pada huruf c angka 5 di atas, 25% (dua puluh lima per seratus) nya dapat berupa uang atau setara kas yang ditempatkan pada Lembaga Kliring;</li>\r\n			<li>Wajib mempertahankan saldo kepemilikan Emas Fisik minimal 2.500 gr (dua ribu lima ratus gram), sebagaimana diatur dalam Peraturan Badan Pengawas Perdagangan Berjangka Komoditi dan Peraturan dan Tata Tertib Lembaga Kliring.</li>\r\n		</ol>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n	<li>Penyesuaian Biaya Kepesertaan Emas Digital Di Luar Bursa sebagai berikut :\r\n	<ul>\r\n		<li>Biaya Pendaftaran sebesar Rp. 200.000.000,- (dua ratus juta rupiah)<a href=\"#_ftn1\" name=\"_ftnref1\">[1]</a>, belum termasuk pajak yang berlaku.\r\n		<p>&nbsp;</p>\r\n\r\n		<hr />\r\n		<p><a href=\"#_ftnref1\" name=\"_ftn1\">[1]</a> Diskon 75% untuk pendaftaran sampai dengan 30 Juni 2021</p>\r\n		</li>\r\n		<li>Iuran bulanan sebesar Rp. 6.000.000,- (enam juta rupiah)<a href=\"#_ftn1\" name=\"_ftnref1\">[1]</a>, belum termasuk pajak yang berlaku dan dibayar di muka sebelum tanggal 10 setiap bulan berjalan\r\n		<p>&nbsp;</p>\r\n\r\n		<hr />\r\n		<p><a href=\"#_ftnref1\" name=\"_ftn1\">[1]</a> Diskon 50% untuk 3 (tiga) bulan pertama bagi pendaftaran sampai dengan 30 Juni 2021</p>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n</ol>\r\n', NULL, NULL);
INSERT INTO `jfx_produk` (`kode_kontrak`, `id_kategori`, `id_subkategori`, `nama_produk`, `slug_produk`, `definisi`, `file_upload`) VALUES
('GOL', 1, NULL, 'KONTRAK BERJANGKA EMAS 1 KG', 'kontrak-berjangka-emas-1-kg', 'Kontrak berjangka emas 1 Kg merupakan kontrak dengan underlying emas batangan 1kg dengan kemurnian 99,99% yang dilengkapi sertifikat yang diakui LBMA. Kontrak ini memiliki jatuh tempo dengan masa transaksi paling lama tiga bulan untuk tiap-tiap bulan kontraknya. Pada saat jatuh tempo kontrak, bisa dilakukan serah terima emas batangan secara fisik sesuai dengan ketentuan yang berlaku. ', '1546LAMPIRAN 1A1.1 - Kontrak Berjangka Emas 1 Kg.pdf'),
('GOL250', 1, NULL, 'KONTRAK BERJANGKA EMAS 250 GRAM', 'kontrak_berjangka_emas_250_gram', 'Kontrak berjangka emas 250 gr merupakan kontrak dengan underlying emas batangan 250 gr dengan kemurnian 99,99% yang dilengkapi sertifikat ANTAM. Kontrak ini memiliki jatuh tempo dengan masa transaksi paling lama tiga bulan untuk tiap-tiap bulan kontraknya. Pada saat jatuh tempo kontrak, bisa dilakukan serah terima emas batangan secara fisik sesuai dengan ketentuan yang berlaku. \r\n\r\nSatuan kontrak 250 gr yang tidak terlalu besar ini diharapkan bisa menjadi produk yang terjangkau oleh banyak pelaku pasar, namun memiliki nilai yang cukup besar untuk memberikan hasil yang signifikan dari tiap-tiap pergerakan harganya.\r\n\r\nSebagai alternatif investasi, kontrak berjangka emas dapat dimanfaatkan untuk memanfaatkan peluang capital gain jangka waktu pendek.', '5184LAMPIRAN 1A1 2 - Kontrak Berjangka Emas 250 Gram.pdf'),
('GOL100', 1, NULL, 'KONTRAK BERJANGKA EMAS 100 GRAM', '', 'Kontrak berjangka emas 100 gr merupakan kontrak dengan underlying emas batangan 100 gr dengan kemurnian 99,99% yang dilengkapi sertifikat ANTAM. Kontrak ini memiliki jatuh tempo dengan masa transaksi paling lama tiga bulan untuk tiap-tiap bulan kontraknya. Pada saat jatuh tempo kontrak, bisa dilakukan serah terima emas batangan secara fisik sesuai dengan ketentuan yang berlaku. \r\n\r\nKontrak 100 gram yang lebih kecil ini memiliki nilai yang lebih kecil sehingga diharapkan bisa memfasilitasi lebih banyak pelaku pasar baik untuk aktivitas lindung nilai maupun untuk tujuan-tujuan investasi. Sebagai alternatif investasi, kontrak berjangka emas dapat dimanfaatkan untuk memanfaatkan peluang capital gain jangka waktu pendek.', NULL),
('OLE', 1, NULL, 'KONTRAK BERJANGKA OLEIN 20 TON', '', 'Palm Olein adalah minyak goreng yang dibuat dari kelapa sawit. Sebagian besar olein yang diproduksi Indonesia digunakan untuk konsumsi dalam negeri. Hal ini membuat keberadaan kontrak berjangka Olein menjadi penting baik sebagai sarana lindung nilai, maupun sebagai sarana jual-beli minyak goreng itu sendiri. \r\n\r\nOlein merupakan salah satu minyak terbaik untuk menggoreng karena sifatnya yang tidak berubah pada tingkat suhu yang tinggi. Selain itu, olein merupakan minyak goreng utama bagi masyarakat Indonesia. \r\n\r\nKontrak berjangka Olein 20 Ton memiliki periode transaksi enam bulan untuk tiap-tiap bulan kontrak yang diperdagangkan. Pada saat jatuh tempo, pelaku pasar bisa memilih untuk melakukan serah terima pada tangki-tangki terdaftar.', '5840LAMPIRAN 1A1 - Olein 20 Ton.pdf'),
('OLE10', 1, NULL, 'KONTRAK BERJANGKA OLEIN 10 TON', '', 'Palm Olein adalah minyak goreng yang dibuat dari kelapa sawit. Sebagian besar olein yang diproduksi Indonesia digunakan untuk konsumsi dalam negeri. Hal ini membuat keberadaan kontrak berjangka Olein menjadi penting baik sebagai sarana lindung nilai, maupun sebagai sarana jual-beli minyak goreng itu sendiri. \r\n\r\nOlein merupakan salah satu minyak terbaik untuk menggoreng karena sifatnya yang tidak berubah pada tingkat suhu yang tinggi. Selain itu, olein merupakan minyak goreng utama bagi masyarakat Indonesia. \r\n\r\nKontrak berjangka Olein 10 Ton yang bernilai lebih kecil diharapkan bisa menjadi sarana hedging yang lebih mudah disesuaikan kelipatannya untuk mendapatkan nilai setara dengan kebutuhan hedging aktual. Periode transaksi kontrak ini adalah enam bulan untuk tiap-tiap bulan kontrak yang diperdagangkan. Pada saat jatuh tempo, pelaku pasar bisa memilih untuk melakukan serah terima sesuai ketentuan yang berlaku pada tangki-tangki terdaftar.', '446LAMPIRAN 1A2 - Olein 10 Ton.pdf'),
('CC5', 1, NULL, 'KONTRAK BERJANGKA KAKAO', '', 'Indonesia merupakan salah satu produsen utama kakao dunia. Dengan harapan bisa meningkatkan daya saing industri kakao nasional melalui penyediaan fasilitas lindung nilai, kontrak berjangka kakao 5 ton di JFX disesuaikan dengan kondisi produksi kakao di Indonesia.\r\n\r\nKontrak berjangka kakao ini memiliki periode transaksi satu tahun untuk tiap-tiap bulan kontraknya. Pada saat jatuh tempo kontrak, pelaku pasar bisa memilih penyelesaian dengan serah terima komoditi sesuai dengan ketentuan yang berlaku pada gudang-gudang terdaftar yang berada pada wilayah produksi kakao di Indonesia.', '5669LAMPIRAN 1C - Kakao.pdf'),
('RCF', 1, NULL, 'KONTRAK BERJANGKA KOPI ROBUSTA', '', 'Indonesia merupakan salah satu produsen utama Kopi Robusta dunia. Dari total produksi kopi di Indonesia, 80% merupakan kopi robusta. Kopi robusta merupakan jenis kopi dengan tingkat keasaman yang lebih tinggi dengan rasa pahit dan umumnya digunakan untuk espresso, dan sebagai pencampur dalam racikan kopi bubuk.\r\n\r\nKontrak Berjangka Kopi Robusta bisa menjadi sarana lindung nilai bagi pelaku industri kopi di Indonesia. Kontrak Berjangka Kontrak Berjangka Kopi Robusta memiliki periode perdagangan satu tahun untuk tiap-tiap bulan kontrak yang diperdagangkan. Pada saat jatuh tempo, pelaku pasar bisa memilih untuk melakukan serah terima fisik kopi robusta sesuai ketentuan yang berlaku pada gudang-gudang terdaftar yang berlokasi dekat sentra produksi kopi robusta.', '4650LAMPIRAN 1B1 - Robusta Coffee.pdf'),
('ACF', 1, NULL, 'KONTRAK BERJANGKA KOPI ARABIKA', '', 'Kopi arabika menyumbang 75-80 persen dari produksi kopi di dunia, sedangkan robusta 20 persen. Brazil diketahui menjadi negara terbesar pengekspor kopi arabika, sementara pengekspor robusta berasal dari Vietnam. Indonesia menjadi urutan kedua setelah Brazil dalam bidang ekspor kopi. Arabika dan robusta menjadi kopi yang paling dikenal oleh dunia.\r\n\r\nKontrak Berjangka Kopi Arabika bisa menjadi sarana lindung nilai bagi pelaku specialty coffee di Indonesia. Fluktuasi harganya bisa dimanfaatkan oleh pelaku pasar secara umum untuk memanfaatkan peluang mendapatkan capital gain. Kontrak Berjangka Kopi Arabika memiliki periode perdagangan satu tahun untuk tiap-tiap bulan kontrak yang diperdagangkan. Pada saat jatuh tempo, pelaku pasar bisa memilih untuk melakukan serah terima fisik kopi arabika sesuai ketentuan yang berlaku pada gudang-gudang terdaftar yang berlokasi dekat sentra produksi kopi arabika.', '9181LAMPIRAN 1B2 - Arabika Coffee.pdf'),
('GG5', 2, NULL, 'KONTRAK BERKALA EMAS 5 GRAM', '', 'Kontrak Berkala Emas merupakan hasil inovasi Bursa Berjangka Jakarta yang menggabungkan sifat-sifat dari produk investasi gadai emas, kontrak berjangka, dan kontrak gulir. Kontrak ini merupakan produk investasi emas yang memberikan kebebasan sepenuhnya kepada pelaku pasar untuk mengatur proses perkembangan investasinya. Pelaku pasar bisa membeli kontrak emas dengan margin layaknya kontrak berjangka, namun dengan memanfaatkan harga spot layaknya kontrak gulir. Selanjutnya, pelaku pasar bisa memilih untuk mencicil emas yang dibelinya sesuai dengan kemampuannya tanpa ketentuan apapun, atau langsung membayar tunai. Pelaku pasar juga mendapat kebebasan untuk memilih penyelesaian tunai, menerima emas secara fisik, atau menggulirkan posisi transaksi untuk memanfaatkan peluang pergerakan harga lebih lanjut. Pilihan sepenuhnya ada pada pelaku pasar.\r\n\r\nKontrak Berkala Emas 5 Gram merupakan satuan terkecil dalam rangkaian produk Kontrak Berkala Emas dengan serah terima fisik berupa keping emas 5 Gram dengan kemurnian 99,99% yang dilengkapi sertifikat ANTAM.', '7336LAMPIRAN 1A3 1 - GG5.pdf'),
('GG25', 2, NULL, 'KONTRAK BERKALA EMAS 25 GRAM', '', 'Kontrak Berkala Emas merupakan hasil inovasi Bursa Berjangka Jakarta yang menggabungkan sifat-sifat dari produk investasi gadai emas, kontrak berjangka, dan kontrak gulir. Kontrak ini merupakan produk investasi emas yang memberikan kebebasan sepenuhnya kepada pelaku pasar untuk mengatur proses perkembangan investasinya. Pelaku pasar bisa membeli kontrak emas dengan margin layaknya kontrak berjangka, namun dengan memanfaatkan harga spot layaknya kontrak gulir. Selanjutnya, pelaku pasar bisa memilih untuk mencicil emas yang dibelinya sesuai dengan kemampuannya tanpa ketentuan apapun, atau langsung membayar tunai. Pelaku pasar juga mendapat kebebasan untuk memilih penyelesaian tunai, menerima emas secara fisik, atau menggulirkan posisi transaksi untuk memanfaatkan peluang pergerakan harga lebih lanjut. Pilihan sepenuhnya ada pada pelaku pasar.\r\n\r\nKontrak Berkala Emas 25 Gram merupakan satuan terkecil dalam rangkaian produk Kontrak Berkala Emas dengan serah terima fisik berupa keping emas 5 Gram dengan kemurnian 99,99% yang dilengkapi sertifikat ANTAM.', '2994LAMPIRAN 1A3 1 - GG25.pdf'),
('GG10', 2, NULL, 'KONTRAK BERKALA 10 GRAM', '', 'Kontrak Berkala Emas merupakan hasil inovasi Bursa Berjangka Jakarta yang menggabungkan sifat-sifat dari produk investasi gadai emas, kontrak berjangka, dan kontrak gulir. Kontrak ini merupakan produk investasi emas yang memberikan kebebasan sepenuhnya kepada pelaku pasar untuk mengatur proses perkembangan investasinya. Pelaku pasar bisa membeli kontrak emas dengan margin layaknya kontrak berjangka, namun dengan memanfaatkan harga spot layaknya kontrak gulir. Selanjutnya, pelaku pasar bisa memilih untuk mencicil emas yang dibelinya sesuai dengan kemampuannya tanpa ketentuan apapun, atau langsung membayar tunai. Pelaku pasar juga mendapat kebebasan untuk memilih penyelesaian tunai, menerima emas secara fisik, atau menggulirkan posisi transaksi untuk memanfaatkan peluang pergerakan harga lebih lanjut. Pilihan sepenuhnya ada pada pelaku pasar.\r\n\r\nKontrak Berkala Emas 10 Gram merupakan satuan terkecil dalam rangkaian produk Kontrak Berkala Emas dengan serah terima fisik berupa keping emas 5 Gram dengan kemurnian 99,99% yang dilengkapi sertifikat ANTAM.', '9932LAMPIRAN 1A3 1 - GG10.pdf'),
('GG50', 2, NULL, 'KONTRAK BERKALA EMAS 50 GRAM', '', 'Kontrak Berkala Emas merupakan hasil inovasi Bursa Berjangka Jakarta yang menggabungkan sifat-sifat dari produk investasi gadai emas, kontrak berjangka, dan kontrak gulir. Kontrak ini merupakan produk investasi emas yang memberikan kebebasan sepenuhnya kepada pelaku pasar untuk mengatur proses perkembangan investasinya. Pelaku pasar bisa membeli kontrak emas dengan margin layaknya kontrak berjangka, namun dengan memanfaatkan harga spot layaknya kontrak gulir. Selanjutnya, pelaku pasar bisa memilih untuk mencicil emas yang dibelinya sesuai dengan kemampuannya tanpa ketentuan apapun, atau langsung membayar tunai. Pelaku pasar juga mendapat kebebasan untuk memilih penyelesaian tunai, menerima emas secara fisik, atau menggulirkan posisi transaksi untuk memanfaatkan peluang pergerakan harga lebih lanjut. Pilihan sepenuhnya ada pada pelaku pasar.\r\n\r\nKontrak Berkala Emas 50 Gram merupakan satuan terkecil dalam rangkaian produk Kontrak Berkala Emas dengan serah terima fisik berupa keping emas 5 Gram dengan kemurnian 99,99% yang dilengkapi sertifikat ANTAM.', '121LAMPIRAN 1A3 1 - GG50.pdf'),
('GG100', 2, NULL, 'KONTRAK BERKALA EMAS 100 GRAM', '', 'Kontrak Berkala Emas merupakan hasil inovasi Bursa Berjangka Jakarta yang menggabungkan sifat-sifat dari produk investasi gadai emas, kontrak berjangka, dan kontrak gulir. Kontrak ini merupakan produk investasi emas yang memberikan kebebasan sepenuhnya kepada pelaku pasar untuk mengatur proses perkembangan investasinya. Pelaku pasar bisa membeli kontrak emas dengan margin layaknya kontrak berjangka, namun dengan memanfaatkan harga spot layaknya kontrak gulir. Selanjutnya, pelaku pasar bisa memilih untuk mencicil emas yang dibelinya sesuai dengan kemampuannya tanpa ketentuan apapun, atau langsung membayar tunai. Pelaku pasar juga mendapat kebebasan untuk memilih penyelesaian tunai, menerima emas secara fisik, atau menggulirkan posisi transaksi untuk memanfaatkan peluang pergerakan harga lebih lanjut. Pilihan sepenuhnya ada pada pelaku pasar.\r\n\r\nKontrak Berkala Emas 100 Gram merupakan satuan terkecil dalam rangkaian produk Kontrak Berkala Emas dengan serah terima fisik berupa keping emas 5 Gram dengan kemurnian 99,99% yang dilengkapi sertifikat ANTAM.', '3833LAMPIRAN 1A3 1 - GG100.pdf'),
('KIE', 3, NULL, 'KONTRAK GULIR INDEKS EMAS', '', 'Berdasarkan definisi, indeks merupakan sarana yang berfungsi menunjukkan suatu nilai atau jumlah. Emas internasional diperdagangkan dalam Dollar AS sehingga membuat harga emas di Indonesia seringkali berfluktuasi mengikuti pergerakan kurs Dollar AS terhadap Rupiah.\r\n\r\nIndeks emas dihasilkan dengan memperbandingkan harga emas di Indonesia dengan harga emas internasional. Nilai indeks yang dihasilkan merupakan suatu nilai yang setara dengan kurs Dollar AS. Oleh karena itu, kontrak gulir indeks emas merupakan kontrak yang bisa secara langsung digunakan untuk melakukan lindung nilai atas pergerakan kurs Dollar AS terhadap Rupiah.\r\n\r\nSebagai kontrak gulir, posisi terbuka akan digulirkan ke perdagangan hari berikutnya sehingga kontrak ini tidak memiliki waktu jatuh tempo.', '6418LAMPIRAN 1A2 5 - Kontrak Gulir Indeks Emas.pdf'),
('KGE', 3, NULL, 'KONTRAK GULIR EMAS 1 KG', '', 'Kontrak Gulir Emas 1 Kg merupakan kontrak emas berdasarkan harga spot emas internasional yang dikonversikan ke dalam Rupiah per gram. Sebagai kontrak gulir, posisi terbuka akan digulirkan ke perdagangan hari berikutnya sehingga kontrak ini tidak memiliki waktu jatuh tempo.\r\n\r\nKontrak ini bisa bermanfaat bagi pelaku pasar ekspor impor untuk melihat acuan harga emas internasional dengan cepat dalam kurs Rupiah. Pergerakan harga emas internasional yang cepat juga membuat pergerakan nilai kontrak ini berfluktuasi dengan cepat.\r\n\r\nPelaku pasar yang menginginkan produk dengan pergerakan yang cepat bisa memanfaatkan kontrak ini untuk memanfaatkan peluang capital gain.', '8819LAMPIRAN 1A2 1 - Kontrak Gulir Emas 1 Kg.pdf'),
('GU1TF', 3, NULL, 'KONTRAK GULIR EMAS USD 10 OZ', '', 'Kontrak Gulir Emas 10 troy oz ini ditransaksikan dalam mata uang Dollar AS. Satuan kontrak yang lebih kecil memiliki nilai yang lebih kecil sehingga diharapkan bisa dimanfaatkan oleh lebih banyak pelaku pasar. Kontrak yang mengacu pada perdagangan emas internasional ini bisa dimanfaatkan oleh pelaku pasar yang sudah terbiasa memanfaatkan pergerakan emas internasional tanpa harus bertransaksi di luar negeri.\r\n\r\nSebagai kontrak gulir, posisi terbuka akan digulirkan ke perdagangan hari berikutnya sehingga kontrak ini tidak memiliki waktu jatuh tempo.', '8186LAMPIRAN 1A2 3 - Kontrak Gulir Emas USD 10 Oz.pdf'),
('KGEUSD', 3, NULL, 'KONTRAK GULIR EMAS 100 OZ', '', 'Kontrak Gulir Emas 100 troy oz ini ditransaksikan dalam mata uang Dollar AS. Kontrak yang mengacu pada perdagangan emas internasional ini bisa dimanfaatkan oleh pelaku pasar yang sudah terbiasa memanfaatkan pergerakan emas internasional tanpa harus bertransaksi di luar negeri.\r\n\r\nSebagai kontrak gulir, posisi terbuka akan digulirkan ke perdagangan hari berikutnya sehingga kontrak ini tidak memiliki waktu jatuh tempo.', '7430LAMPIRAN 1A2 2 - Kontrak Gulir Emas USD 100 Oz.pdf'),
('GU1H10', 3, NULL, 'KONTRAK GULIR EMAS USD FIXED 100 OZ', '', 'Kontrak Gulir Emas 100 troy oz Fixed rate dihitung dalam Dollar AS yang di-peg ke Rp10.000 per Dollar. Kontrak yang mengacu pada perdagangan emas internasional ini bisa dimanfaatkan oleh pelaku pasar yang sudah terbiasa memanfaatkan pergerakan emas internasional tanpa harus bertransaksi di luar negeri. Nilai Dollar AS yang di-peg ke Rupiah membuat pelaku pasar sebenarnya tetap bertransaksi dalam mata uang Rupiah.\r\n\r\nSebagai kontrak gulir, posisi terbuka akan digulirkan ke perdagangan hari berikutnya sehingga kontrak ini tidak memiliki waktu jatuh tempo.', '5768LAMPIRAN 1A2 4 - Kontrak Gulir Emas USD Fixed 100 Oz.pdf'),
('TLEAD 050', 4, NULL, 'PRODUK FISIK TIMAH TLEAD 050', '', 'Timah merupakan salah satu mineral ekonomis yang sangat penting dan potensial di dunia karena mempunyai manfaat yang sangat melimpah. Timah dapat digunakan sebagai logam yang mandiri maupun juga paduan campuran (alloy) dengan logam lain terutama pada tembaga, seperti dalam campuran, perunggu, solder lunak, logam bel, babbitt, bahkan juga dalam pembuatan pipa PvC, dan sebagainya. Timah saat ini juga merupakan salah satu komoditas andalan pertambangan di Indonesia untuk ekspor yang peranannya cukup penting dan tidak tergantikan kebutuhannya bagi perekonomian Nasional. Untuk mendukung peningkatan daya saing ekspor timah serta penyesuaian dengan penetapan sistem klasifikasi barang yang baru dan ketentuan perundang-undangan mengenai pertambangan mineral, Kementerian Perdagangan mengeluarkan Peraturan Menteri Perdagangan Republik Indonesia Nomor 44/M-DAG/PER/7/2014 yang diubah dengan Peraturan Menteri Perdagangan Republik Indonesia Nomor 53 tahun 2018 dan Peraturan Dirjen Perdagangan Luar Negeri No. 05/DAGLU/PER/2/2019 yang antara lain mengatur bahwa timah untuk keperluan ekspor harus diperdagangkan melalui Bursa. Oleh karena itu Bursa Berjangka Jakarta (BBJ) yang selalu berupaya untuk bisa menjadi bursa yang melayani permintaan pasar, Bursa Bejangka Jakarta mengadakan Bursa Timah dalam rangka memenuhi kebutuhan pasar akan adanya keteraturan dalam perdagangan timah nasional. Produk Timah sendiri terdiri dari 5 jenis kontrak yaitu TLEAD 300, TLEAD 200, TLEAD 100, TLEAD 050 dan TPURE099.', NULL),
('TLEAD100', 4, NULL, 'PRODUK FISIK TIMAH TLEAD 100', '', 'Timah merupakan salah satu mineral ekonomis yang sangat penting dan potensial di dunia karena mempunyai manfaat yang sangat melimpah. Timah dapat digunakan sebagai logam yang mandiri maupun juga paduan campuran (alloy) dengan logam lain terutama pada tembaga, seperti dalam campuran, perunggu, solder lunak, logam bel, babbitt, bahkan juga dalam pembuatan pipa PvC, dan sebagainya. Timah saat ini juga merupakan salah satu komoditas andalan pertambangan di Indonesia untuk ekspor yang peranannya cukup penting dan tidak tergantikan kebutuhannya bagi perekonomian Nasional. Untuk mendukung peningkatan daya saing ekspor timah serta penyesuaian dengan penetapan sistem klasifikasi barang yang baru dan ketentuan perundang-undangan mengenai pertambangan mineral, Kementerian Perdagangan mengeluarkan Peraturan Menteri Perdagangan Republik Indonesia Nomor 44/M-DAG/PER/7/2014 yang diubah dengan Peraturan Menteri Perdagangan Republik Indonesia Nomor 53 tahun 2018 dan Peraturan Dirjen Perdagangan Luar Negeri No. 05/DAGLU/PER/2/2019 yang antara lain mengatur bahwa timah untuk keperluan ekspor harus diperdagangkan melalui Bursa. Oleh karena itu Bursa Berjangka Jakarta (BBJ) yang selalu berupaya untuk bisa menjadi bursa yang melayani permintaan pasar, Bursa Bejangka Jakarta mengadakan Bursa Timah dalam rangka memenuhi kebutuhan pasar akan adanya keteraturan dalam perdagangan timah nasional. Produk Timah sendiri terdiri dari 5 jenis kontrak yaitu TLEAD 300, TLEAD 200, TLEAD 100, TLEAD 050 dan TPURE099.', NULL),
('TLEAD300', 4, NULL, 'PRODUK FISIK TIMAH TLEAD 300', '', 'Timah merupakan salah satu mineral ekonomis yang sangat penting dan potensial di dunia karena mempunyai manfaat yang sangat melimpah. Timah dapat digunakan sebagai logam yang mandiri maupun juga paduan campuran (alloy) dengan logam lain terutama pada tembaga, seperti dalam campuran, perunggu, solder lunak, logam bel, babbitt, bahkan juga dalam pembuatan pipa PvC, dan sebagainya. Timah saat ini juga merupakan salah satu komoditas andalan pertambangan di Indonesia untuk ekspor yang peranannya cukup penting dan tidak tergantikan kebutuhannya bagi perekonomian Nasional. Untuk mendukung peningkatan daya saing ekspor timah serta penyesuaian dengan penetapan sistem klasifikasi barang yang baru dan ketentuan perundang-undangan mengenai pertambangan mineral, Kementerian Perdagangan mengeluarkan Peraturan Menteri Perdagangan Republik Indonesia Nomor 44/M-DAG/PER/7/2014 yang diubah dengan Peraturan Menteri Perdagangan Republik Indonesia Nomor 53 tahun 2018 dan Peraturan Dirjen Perdagangan Luar Negeri No. 05/DAGLU/PER/2/2019 yang antara lain mengatur bahwa timah untuk keperluan ekspor harus diperdagangkan melalui Bursa. Oleh karena itu Bursa Berjangka Jakarta (BBJ) yang selalu berupaya untuk bisa menjadi bursa yang melayani permintaan pasar, Bursa Bejangka Jakarta mengadakan Bursa Timah dalam rangka memenuhi kebutuhan pasar akan adanya keteraturan dalam perdagangan timah nasional. Produk Timah sendiri terdiri dari 5 jenis kontrak yaitu TLEAD 300, TLEAD 200, TLEAD 100, TLEAD 050 dan TPURE099.', NULL);
