INSERT INTO `jfx_teknologi` (`id`, `icon`, `judul`, `deskripsi`, `isi`) VALUES
(4, '1', 'JAFeTS NOW', 'JFX telah menerapkan perdagangan berbasis elektronik sejak awal berdirinya. Manajemen Bursa melihat hal ini sebagai suatu kebutuhan dimana semua bursa mengalaminya', '<p>JFX telah menerapkan perdagangan berbasis elektronik sejak awal berdirinya. Manajemen Bursa melihat hal ini sebagai suatu kebutuhan dimana semua bursa mengalaminya. Sistem perdagangan elektronik yang disebut JAFeTS NOW, yang kemudian dirancang untuk memenuhi kriteria manajemen sebagai berikut :</p>\r\n\r\n<ul>\r\n	<li>Penggunaan Teknologi terbaru yang dapat mengakomodasi perkembangan teknologi berikutnya.</li>\r\n	<li>Sistem tersebut masih dapat di kembangkan apabila diperlukan untuk mengakomodasi kebutuhan dan perkembangan pasar.</li>\r\n	<li>Teknologi dengan harga yang terjangkau dalam pengembangannya.</li>\r\n	<li>Menggunakan Teknologi khusus yang dapat diperbaharui apabila diperlukan.</li>\r\n</ul>\r\n\r\n<p>Tujuan dan Manfaat</p>\r\n\r\n<p>Berikut tujuan dari implementasi JAFeTS yang memberikan beberapa manfaat adalah :</p>\r\n\r\n<ul>\r\n	<li>Memberikan kesempatan dan fasilitas yang sama untuk semua peserta pasar.</li>\r\n	<li>Untuk menyediakan fasilitas perdagangan dengan kontrol terpadu yang meminimalkan risiko perdagangan.</li>\r\n	<li>Untuk menyediakan fasilitas perdagangan yang efisien, cepat, ekonomis dan dapat diandalkan.</li>\r\n	<li>Untuk menyediakan sistem yang menggunakan teknologi terbaru setara dengan bursa terkemuka asing.</li>\r\n	<li>Untuk memberikan landasan yang kokoh untuk sistem perdagangan jarak jauh, dimana pelaku pasar dapat mengakses sistem dari tempat mereka.</li>\r\n	<li>Untuk menyediakan sistem yang dapat dengan mudah disesuaikan dengan permintaan pasar seperti yang muncul, seperti: menambahkan produk baru, memperluas jam perdagangan.</li>\r\n</ul>\r\n\r\n<p>Komponen JAFeTS NOW</p>\r\n\r\n<ul>\r\n	<li>Pada dasarnya, ada lima komponen yang membentuk JAFeTS NOW:</li>\r\n	<li>Trader Interface. Ini adalah layar yang Layar Pedagang dapat masukkan, mengubah, dan menghapus perintah. Mereka juga dapat melihat situasi pasar secara keseluruhan melalui antarmuka ini.</li>\r\n	<li>Informasi Perdagangan. Publikasi data perdagangan mengutip vendor dan dunia luar dilakukan melalui komponen ini.</li>\r\n	<li>Administrator Interface. Ini digunakan oleh admin anggota bursa untuk menentukan dan mengatur parameter yang mengatur pengoperasian JAFeTS NOW. Parameter yang dapat diatur dalam administrator interface antara lain: jenis kontrak, batas harga, user id layar pedagang dan password, sesi perdagangan.</li>\r\n	<li>Surveillance Aplikasi. Sebuah fasilitas melalui pertukaran petugas surveilans memantau kegiatan pasar.</li>\r\n	<li>Kliring Interface. Data perdagangan dikirim ke rumah kliring elektronik melalui antarmuka ini.</li>\r\n	<li>Data Vendor Interface. Data perdagangan dikirim ke vendor data elektronik melalui antarmuka ini.</li>\r\n	<li>Interface untuk Bappebti. Data perdagangan dikirim ke Bappebti (BAPPEBTI) secara elektronik melalui antar muka ini.</li>\r\n</ul>\r\n\r\n<p>The Next JAFeTS</p>\r\n\r\n<p>JAFeTS NOW merupakan JAFeTS next generation yang mampu:</p>\r\n\r\n<ul>\r\n	<li>Penanganan lebih transaksi per detik dari pendahulunya</li>\r\n	<li>Upgrade fungsi manajemen risiko</li>\r\n	<li>Meningkatkan keandalan dan ketersediaan arus perdagangan Online,</li>\r\n</ul>\r\n'),
(5, '4 ', 'Sistem Aplikasi Emas Digital', 'Produk JFX yang memfasilitasi pembelian emas menggunakan sistem online', '<p>Kontrak Berkala Emas adalah produk JFX hasil perpaduan antara mekanisme perdagangan kontrak berjangka dengan pasar fisik. Kontrak ini yang memungkinkan pembeli untuk memilih lokasi serah terima terdaftar yang terdekat. Dalam rangka itu dibutuhkan suatu platform khusus untuk mekanisme perdagangan produk ini, yang difasilitasi oleh Sistem Aplikasi Kontrak Berkala Emas.</p>\r\n\r\n<p>Berikut fiturnya:</p>\r\n\r\n<p>Fitur ini memberi pilihan bagi pembeli untuk menambah jumlah margin yang disetor pada transaksi yang dilakukan. Fitur ini menyerupai cicilan dalam aktivitas perdagangan emas di pasar fisik. Fitur ini memberi keuntungan bagi pembeli berupa pengurangan tingkat pembiayaan secara harian. Penambahan dana hingga full margin akan menghilangkan tingkat pembiayan harian secara keseluruhan.</p>\r\n\r\n<p>Pilihan bagi pembeli untuk melakukan re-sale (dijual sekarang, dan dijual pada saat jatuh tempo), roll-over (gulir ke bulan kontrak berikutnya), ataupun request delivery (serah terima barang) atas posisi kontrak terbuka yang dimiliki. Pilihan dijual sekarang selalu ada tiap saat. Namun, menu pilihan lainnya muncul saat menjelang akhir bulan pada periode pemberitahuan penyerahan.</p>\r\n\r\n<p>Pemilihan opsi serah terima barang akan membuka menu yang memungkinkan pihak pembeli dapat menentukan tempat serah terima yang terdekat dengan lokasinya.</p>\r\n\r\n<ol>\r\n	<li>Tambah Dana</li>\r\n	<li>Rencana Penyelesaian Sebelum Jatuh Tempo</li>\r\n	<li>Serah Terima Barang</li>\r\n</ol>\r\n'),
(6, '3', 'Sistem Pasar Fisik', 'JFX telah menerapkan perdagangan berbasis elektronik sejak awal berdirinya. Sistem Perdagangan Elektronik telah menjadi tren di seluruh dunia sejak era 90-an.', '<p>JFX telah menerapkan perdagangan berbasis elektronik sejak awal berdirinya. Sistem Perdagangan Elektronik telah menjadi tren di seluruh dunia sejak era 90-an. JFX juga menggunakan sistem Pengawasan Tunggal untuk pengawasan sistem perdagangan. Dengan sistem ini integritas dan keamanan pasar dapat ditingkatkan melalui transaksi &ndash; transaksi yang termonitor dengan baik. JFX menawarkan teknologi dengan fitur :</p>\r\n\r\n<ol>\r\n	<li><strong>Easy</strong>&nbsp;: Mudah digunakan dengan tampilan yang lebih bersahabat</li>\r\n	<li><strong>Real-time</strong>&nbsp;: Transaksi dapat dilihat secara real time</li>\r\n	<li><strong>Accurate</strong>&nbsp;: Akurasi dan presisi yang lebih handal</li>\r\n	<li><strong>Anytime</strong>&nbsp;: Dapat di akses kapan saja selama ada koneksi internet</li>\r\n	<li><strong>Anywhere</strong>&nbsp;: Kemudahan untuk mengakses di mana saja selama ada koneksi internet</li>\r\n	<li><strong>Low spec hardware</strong>&nbsp;: Dapat di pakai pada perangkat keras yang tidak memiliki spesifikasi terlalu tinggi</li>\r\n	<li><strong>Flexible</strong>&nbsp;: Pengaturan tampilan dan produk yang dapat di atur sesuai dengan kebutuhan pemakai</li>\r\n	<li><strong>Integrated</strong>&nbsp;back office and front office : Bagian client dan back office yang terpadu dalam satu aplikasi</li>\r\n	<li><strong>Secure</strong>&nbsp;: Selain data yang terenkripsi juga ada beberapa metode keamanan yang di terapkan seperti pergantian password secara periodik</li>\r\n	<li><strong>High availability</strong>&nbsp;: Aplikasi yang selalu online selama ada koneksi internet karena server aplikasi yang menggunakan motede clustering dan load balancing yang memastikan aplikasi bisa di akses kapan saja, dan dimana saja</li>\r\n	<li><strong>24 hours</strong>&nbsp;support weekday :Layanan dukungan teknis selama 24 jam di hari kerja</li>\r\n</ol>\r\n\r\n<p>Saat ini, JFX memiliki sistem :</p>\r\n\r\n<p>ITMS (Indonesian Tin Market System)</p>\r\n');
INSERT INTO `jfx_tentang_kami` (`id`, `judul`, `gambar`, `isi`, `petugas`, `slug_judul`) VALUES
(1, 'Sekilas Tentang JFX', NULL, '<p>Jakarta Futures Exchange (JFX) adalah Bursa Berjangka pertama di Indonesia. JFX berdiri pada tanggal 19 Agustus 1999 dengan landasan untuk membawa manfaat besar bagi komunitas bisnis dan sebagai sarana lindung nilai. Peran utama JFX adalah selaku penyedia fasilitas bagi para anggotanya untuk melakukan transaksi kontrak berjangka berdasarkan harga yang ditetapkan melalui interaksi yang efisien berdasarkan permintaan dan penawaran dalam sistem perdagangan elektronik. Pendirian JFX dilandasi oleh Undang Undang Nomor 32 tahun 1997 Tentang Perdagangan Berjangka Komoditi. JFX berkomitmen memberikan solusi dan pelayanan terbaik bagi Industri Perdagangan Berjangka (PBK). Proses transformasi dan pendayagunaan teknologi informasi terkini dioptimalkan untuk merespon tuntutan pasar serta lingkungan bisnis yang dinamis. JFX konsisten melakukan inovasi, pengembangan produk, peningkatan kapasitas serta kompetensi seluruh fungsi dan lini organisasi, serta penyediaan infrastruktur perdagangan komoditi yang berskala internasional. JFX bangga telah menjadi bagian dari sistem penggerak transaksi perdagangan sektor komoditi di tingkat domestik dan global.</p>\r\n', NULL, NULL),
(2, 'visi', NULL, '<p>Dalam rangka mewujudkan sistem perdagangan berjangka komoditi, JFX bekerja berlandaskan visi menjadi bursa yang mampu menyediakan mekanisme price discovery terpercaya, menghasilkan harga acuan komoditi yang diakui dunia, memiliki produk inovatif yang diminati sebagai sarana investasi alternatif dan pengelolaan risiko yang transparan, teratur, wajar, efisien dan efektif.&nbsp;</p>\r\n', NULL, NULL),
(3, 'Misi JFX', NULL, '<p>Untuk mewujudkan visi tersebut, Perseroan menetapkan misi membangun sarana perdagangan berjangka yang berciri :</p>\r\n\r\n<ul>\r\n	<li>Mampu memfasilitasi mekanisme price discovery yang menghasilkan referensi harga yang terpercaya, khususnya untuk komoditas/ jasa yang memiliki peran penting bagi perekonomian nasional;</li>\r\n	<li>Mampu memfasilitasi kebutuhan lindung nilai yang efisien;</li>\r\n	<li>Mampu memberi perlindungan maksimal (optimal) bagi nasabah Perdagangan Komoditi Berjangka;</li>\r\n	<li>Mampu melayani kebutuhan pasar dengan tetap memelihara dan mempertahankan integritas pasar;</li>\r\n	<li>Mampu mendidik masyarakat investor dalam mengelola risiko secara bertanggung jawab;</li>\r\n	<li>Mampu mengembangkan kesempatan usaha bagi para anggota melalui diversifikasi dan diferensiasi produk/ instrumen;</li>\r\n	<li>Mampu merespon arus globalisasi dengan tetap mengutamakan perekonomian dalam negeri.</li>\r\n</ul>\r\n', NULL, NULL),
(4, 'STRUKTUR ORGANISASI', NULL, '<p>Struktur Organisasi.</p>\r\n\r\n<p>Sebagaimana umum berlaku dalam ranah hukum di Indonesia, JFX beroperasi dengan sistem 2 (dua) dewan, yaitu: Dewan Komisaris dan Direksi.</p>\r\n\r\n<p>Sebagai tambahan dari ketentuan ini, Undang-undang Perdagangan Berjangka Nomor 32 Tahun 1997 menyebutkan bahwa minimal 1(satu) orang anggota Dewan Komisaris mewakili masyarakat dan semua Direktur adalah profesional yang bekerja penuh waktu. Baik anggota Dewan Komisaris maupun Jajajaran Direksi harus melalui dan lolos dari fit and proper test yang diselenggarakan oleh Badan Pengawas Perdagangan Berjangka Komoditi (Bappebti). Sehari-hari, Manajemen dijalankan oleh Direksi di mana masing-masing mengawasi 3(tiga) dari 6(enam) divisi yang ada sebagaimana tercantum dalam struktur organisasi.</p>\r\n\r\n<p>Struktur Organisasi Jakarta Futures Exchange&nbsp;Anggota JFX terdiri atas 4 (empat) kategori, yaitu :</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://new.bbj.co.id:8080/jfx_fix/images/jfx/struktur.png\"><img alt=\"\" src=\"http://new.bbj.co.id:8080/jfx_fix/images/jfx/struktur.png\" style=\"height:371px; width:877px\" /></a></p>\r\n\r\n<p>Sebagai tambahan Pialang harus memiliki minimal 1(satu) seat.</p>\r\n\r\n<ol>\r\n	<li>Pedagang, yaitu anggota bursa yang telah terdaftar di Bappebti. Peran ini terdiri atas :\r\n	<ul>\r\n		<li>Pedagang perusahaan, hanya dapat bertransaksi untuk rekeningnya sendiri dan/atau kelompok usahanya;</li>\r\n		<li>Pedagang perusahaan, harus memiliki setidaknya 1 seat;</li>\r\n		<li>Pedagang perorangan, hanya dapat bertransaksi untuk rekeningnya sendiri;</li>\r\n		<li>Pedagang perorangan, harus memiliki seat atau menyewa minimal 1 (satu) seat.</li>\r\n	</ul>\r\n	</li>\r\n	<li>Pialang, yaitu anggota bursa berbentuk badan usaha perusahaan dan telah mendapatkan izin dari Bappebti. Pialang boleh menerima amanat dari nasabah.</li>\r\n	<li>Pihak yang sedang dalam proses untuk menjadi Pialang atau Pedagang.</li>\r\n	<li>Pemegang Saham Pendiri, yang tidak memiliki izin atau terdaftar selaku Pialang atau Pedagang, sebagaimana diaturdalam Pasal 12(2) Undang Undang Nomor 32 Tahun 1997.</li>\r\n</ol>\r\n', NULL, NULL);
